import Link from 'next/link';
import { Button } from 'reactstrap';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
        <a style={linkStyle}>ChirpOut</a>
    </Link>
    <Link href="/find-workplace">
        <a style={linkStyle}>FIND A WORKPLACE</a>
    </Link>
    <Link href="/for-workplaces">
        <a style={linkStyle}>FOR WORKPLACES</a>
    </Link>
    <Link href="/login">
        <Button color="danger">LOG IN</Button>
    </Link>
  </div>
);

export default Header;
